chte etwa der Verband der Kabelnetzbetreiber, Swisscable, im Mai 2010 Beschwerde bei der Weko wegen eines Kooperationsvertrages zwischen der Stadt St. Gallen und Swisscom ein. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",Qcc='Dienstag',Ayc='Dimension',wkc='Dimension [height=',Quc='DirectionalTextHelper',edc='Do',Zcc='Do.',Tuc='DockLayoutPanel',Uuc='DockLayoutPanel$Direction',Vuc='DockLayoutPanel$Direction;',Yuc='DockLayoutPanel$DockAnimateCommand',Wuc='DockLayoutPanel$LayoutData',arc='DomEvent',frc='DomEvent$Type',Scc='Donnerstag',ixc='Double',yhc='EAST',_9b='EEE, d MMM yyyy HH:mm:ss Z',pnc='EEE. dd MMM. yyyy HH:mm:ss',tac='EEEE d. MMMM',cac='EEEE, d. MMMM y',B8b='EM',ffc='EMPTY',kfc='ENABLED',rdc='END',D8b='EX',ytc='ElementMapperImpl',ztc='ElementMapperImpl$FreeNode',rcc='English',nqc='Enum',icc='Etc/GMT',kcc='Etc/GMT+',jcc='Etc/GMT-',S8b='Event type',owc
